import React from "react"

class MyButton extends React.Component {
    constructor(props){
        super(props);
        }
    render () {
        return (
            <button
                className={
                props.type == "primary" ? "btn btn-primary" : "btn btn-secondary"
                }
                onClick={this.props.action}
            >
                {this.props.title}
            </button>
        );
    }
}
export default MyButton
